package main

import "fmt"

func numSubarraysWithSum(nums []int, goal int) int {
	n := len(nums)
	ans := 0
	for i := 0; i < n; i++ {
		total := 0
		for idx := i; idx < n; idx++ {
			total += nums[idx]
			if total == goal {
				ans++
			}
		}
	}
	return ans
}

